import json
from datetime import datetime
from typing import List, Dict, Optional

class UserStory:
    def __init__(self, role: str, description: str, cluster: int):
        self.role = role
        self.description = description
        self.cluster = cluster

class Cluster:
    def __init__(self, cluster_id: int, stories: List[UserStory]):
        self.cluster_id = cluster_id
        self.stories = stories

    def add_story(self, story: UserStory):
        self.stories.append(story)

class UserStoryManager:
    def __init__(self):
        self.clusters = {}

    def add_story(self, role: str, description: str, cluster_id: int):
        if cluster_id not in self.clusters:
            self.clusters[cluster_id] = Cluster(cluster_id, [])
        story = UserStory(role, description, cluster_id)
        self.clusters[cluster_id].add_story(story)

    def get_stories_by_cluster(self, cluster_id: int) -> List[UserStory]:
        return self.clusters.get(cluster_id, Cluster(cluster_id, [])).stories

    def get_all_clusters(self) -> Dict[int, Cluster]:
        return self.clusters

class ValidationRules:
    @staticmethod
    def validate_duns(duns: str, action_type: str, registration_date: datetime) -> bool:
        """Validate DUNS based on action type and registration date."""
        valid_action_types = {'B', 'C', 'D'}
        if action_type in valid_action_types and duns and len(duns) == 9:
            return registration_date is not None
        return False

    @staticmethod
    def validate_zip_code(zip_code: str, include_plus4: bool = True) -> bool:
        """Validate ZIP code, optionally including ZIP+4."""
        if include_plus4:
            return len(zip_code) in (5, 10) and zip_code.isdigit()
        return len(zip_code) == 5 and zip_code.isdigit()

class DataLoader:
    @staticmethod
    def load_historical_fpds_data(year: int = 2007) -> List[Dict]:
        """Load historical FPDS data from a given year."""
        return [{"id": i, "year": year, "data": f"FPDS data for {year}"} for i in range(1, 100)]

    @staticmethod
    def load_fabs_data() -> List[Dict]:
        """Load FABS data."""
        return [{"id": i, "status": "published", "data": f"FABS data {i}"} for i in range(1, 50)]

class FileProcessor:
    def __init__(self):
        self.validation_rules = ValidationRules()

    def process_upload(self, file_path: str, file_type: str) -> Dict:
        """Process uploaded file and return validation results."""
        errors = []
        if not file_path.endswith(file_type):
            errors.append(f"Invalid file extension. Expected {file_type}")
        return {"file_path": file_path, "errors": errors, "is_valid": len(errors) == 0}

class SubmissionManager:
    def __init__(self):
        self.submissions = {}
        self.lock = False

    def submit(self, submission_id: str, data: Dict) -> Dict:
        """Submit data and prevent duplicate submissions."""
        if self.lock:
            return {"status": "error", "message": "Submission is currently locked"}
        if submission_id in self.submissions:
            return {"status": "error", "message": "Duplicate submission"}

        self.lock = True
        self.submissions[submission_id] = data
        self.lock = False
        return {"status": "success", "submission_id": submission_id}

class UIManager:
    def __init__(self):
        self.pages = {
            "Homepage": "Initial design",
            "Help": "Initial design",
            "Resources": "Initial design",
            "DABS": "Initial design",
            "FABS": "Initial design"
        }

    def update_page_design(self, page: str, new_design: str) -> None:
        """Update the design of a specific page."""
        if page in self.pages:
            self.pages[page] = new_design

class Broker:
    def __init__(self):
        self.user_story_manager = UserStoryManager()
        self.file_processor = FileProcessor()
        self.submission_manager = SubmissionManager()
        self.ui_manager = UIManager()
        self.data_loader = DataLoader()

    def load_user_stories(self, stories_data: List[Dict]) -> None:
        """Load user stories from a list of dictionaries."""
        for story in stories_data:
            self.user_story_manager.add_story(story["role"], story["description"], story["cluster"])

    def get_cluster_stories(self, cluster_id: int) -> List[UserStory]:
        """Get all user stories for a specific cluster."""
        return self.user_story_manager.get_stories_by_cluster(cluster_id)

# Example usage
if __name__ == "__main__":
    broker = Broker()

    # Load sample user stories
    sample_stories = [
        {"role": "Data user", "description": "Have the 12-19-2017 deletions processed", "cluster": 4},
        {"role": "UI designer", "description": "Redesign the Resources page", "cluster": 4},
        {"role": "Developer", "description": "Update the FABS sample file", "cluster": 2},
        {"role": "FABS user", "description": "See correct status labels on the Submission Dashboard", "cluster": 1}
    ]
    broker.load_user_stories(sample_stories)

    # Process a file upload
    result = broker.file_processor.process_upload("data.csv", ".csv")
    print("File upload result:", result)

    # Submit data
    submission_result = broker.submission_manager.submit("123", {"key": "value"})
    print("Submission result:", submission_result)

    # Get cluster stories
    cluster_4_stories = broker.get_cluster_stories(4)
